The next three components are a bit more complicated, so we'll be spending a little more time explaining how they work. Each of these components requires some information about the document itself (things like the page numbers of entries, etc.). Normally fetching this data can be rather annoying, but fortunately the Notebookinator has created some utility functions to abstract this. To get started with your table of contents, first define a function called toc in your foo/components/toc.typ file. However, unlike the pro-con function, this function will depend on the print-toc utility function. This looks like this: // foo/components/toc.typ // Use this import if you're developing in the Notebookinator directly
#import "/utils.typ" // Use this import if you're using the notebookinator as an external dependency
#import "@local/notebookinator:1.0.1": utils #let toc() = utils.print-toc((frontmatter, body, appendix) =&gt; { // ...
} This syntax might look a little weird, so lets break it down. We're defining the function toc, which is equal to the utils.print-toc function. The utils.print-toc function takes 1 argument, and this argument is a function. We're choosing to pass in a lambda function here, since this function only makes sense in the context of the table of contents (we won't need to call it in multiple places). Inside this lambda we have access to the frontmatter, body, and appendix variables. These variables are all arrays , which dictionaries which all contain the same information as the ctx variables from this section, with the addition of a page-number field, which is an integer . With these variables, we can simply loop over each one, and print out another entry in the table of contents each time. Here's what that looks like for the frontmatter entries: // foo/components/toc.typ #import "/utils.typ" #let toc() = utils.print-toc((_, body, appendix) =&gt; { // replace frontmatter with _ // to indicate we aren't using it heading[Contents] stack(spacing: 0.5em, ..for entry in body { ([ #entry.title #box(width: 1fr, line(length: 100%, stroke: (dash: "dotted"))) #entry.page-number ],) }) // TODO: do the same loop for the body entries as well
}

