The Notebookinator allows for three different types of entries, frontmatter, body, and appendix. Each will be rendered as its own section, and has its own page count. Frontmatter Frontmatter entries, as their name implies, are shown at the beginning of the notebook. Entries of this type typically contain things like introductions, and the table of contents. The template stores all of the frontmatter entries into the frontmatter.typ file by default. To add more frontmatter entries, simply call the create-frontmatter-entry function inside of the file like so: #create-frontmatter-entry(title: "About")[ Here's some info about this amazing notebook!
] Frontmatter entries are rendered in the order they are created. Body The most common type of entry is the body entry. These entries store all of your notebook's main content. The template puts all of the body entries inside of the entries/ folder. To make a new entry, make a new file in that folder. Then, #include that file in the entries/entries.typ file. For example, if you created a file called entries/my-entry.typ, then you'd add this line to your entries/entries.typ file: #include "./my-entry.typ" Body entries will be displayed in the order they are included in the entries/entries.typ file. Once you've done that, you'll need to create a new entry inside of that file. This can be done with the create-body-entry function. If the file only contains a single entry, we recommend using a show rule to wrap the function as well, which will pass all of the content in the file into the create-body-entry function. You can create a new body entry like so: // not all themes require every one of these options
#show: create-body-entry.with( title: "My Awesome Entry", type: "identify", // The type of the entry depends on which theme you're using date: datetime(year: 2024, month: 1, day: 1),
) Appendix Appendix entries go at the end of the notebook, and are stored in the appendix.typ file. You can create a new appendix entry like this: #create-appendix-entry(title: "Programming")[ Here's information about how we programmed the robot. #lorem(500)
]
